import React from "react";
import { Jumbotron, Container } from "react-bootstrap";

const Hero = () => {
  return (
    <Jumbotron>
      <Container>
        <Row>
          <col>
            <h2>Eduardo Mendoza</h2>
          </col>
        </Row>
      </Container>
    </Jumbotron>
  );
};

export default Hero;
